import Vue from "vue";
import App from "./App.vue";
import router from "./router";


import MaterialKit from "./plugins/material-kit";

Vue.config.productionTip = false;

Vue.use(MaterialKit);


new Vue({
  router,
  render: h => h(App)
}).$mount("#app");
